import React, { Component } from "react";
import AOS from "aos";

export default class Title extends Component {
  componentDidMount() {
    AOS.init();
    AOS.init({
      duration: 2000,
    });
  }

  render() {
    return (
      <div data-aos="fade-right">
        <h1 className="titleName">Charlotte Mountain</h1>
        <h3 className="titleJob">WEB DEVELOPER</h3>
      </div>
    );
  }
}
